response.about:
Милая; добрая; сентиментальная; порой не понятная;
вначале делаю,а потом говорю;улыбаюсь незнакомым людям;
много мечтаю и смотрю на небо; люблю романтику и цветы; люблю грустить,а потом смеяться ; быстро прощаю; люблю горячий чай с шоколадом,а еще леденцы; люблю просыпаться с улыбкой,и не люблю засыпать со слезами; люблю сюрпризы и громкую музыку; люблю яркие фото; и просто люблю…
